import { StyleSheet, Text, View } from "react-native";
import React, { useState } from "react";

const Message = () => {
  const [data, setData] = useState([
    {
      username: "Zaid Sidd",
      text: "hello",
    },
    {
      username: "Saif Sidd",
      text: "Heyy",
    },
  ]);
  return (
    <View>
      <View style={styles.message}>
        <Text>Hello</Text>
      </View>
    </View>
  );
};

export default Message;

const styles = StyleSheet.create({
  message: {
    alignItems: "center",
  },
});
